      "insta": "carineyrafael",
      "bio": "Rafael Barros and Carine Morais, with 16 years of partnership and over 27 years of dance experience, are renowned as eight-time World Salsa Champions. Specialists in salsa on1, they have developed a unique style influenced by Brazilian dances. Their achievements include victories in prestigious competitions such as the World Salsa Open in Puerto Rico, the World Latin Dance Cup, and the World Salsa Championship in the USA, as well as the Six Degrees in Canada.\n\nDirectors of Uzume Dance Company in Miami, Rafael and Carine have shared their expertise in over 35 countries, being highly sought-after teachers and choreographers. They also serve as judges at the world‚Äôs most important salsa competitions, including The Summit, World Latin Dance Cup, Euroson Latino, and Latin Dance Crown, as well as numerous other global championships.",
