      "insta": "natasha.tia",
      "bio": "Natasha Tia has trained extensively in dance styles across many genres for over 30 years. In her 20 year mambo dancing career Miss Tia‚Äôs reputation of professionalism, strong technique, and energetic quality has enabled her to teach and perform with world class artists all over the world. In June 2020 Natasha founded 'Movewise Wellness,' a hybrid, on zoom + in person + on demand, platform specializing in Ayurvedic Sports Nutrition for dancers and athletes. A platform centered around teaching dancers how to tap into their unique self expression, deepen their mind-body-spirit connection, and ultimately gain confidence to feel freedom while dancing. Current offerings include weekly drop-in classes, monthly seminars, 1:1 tailored mentorship programs, performance and training projects, and private consulting.",
