      "insta": "kate.katlynxr",
      "bio": "Kate Rodriguez is a professional dancer, choreographer and company director from New York. She is the director, owner and choreographer of Kate‚Äôs Dance Co. Kate is also the owner and founder of the open level dance training camp for adults ‚ÄúKamp Kate‚Äù happening Labor Day weekend of 2024.\n\nStarting at the age of 5 year old, Katlyn has also trained in many dance styles such as salsa, bachata, Bollywood, hip hop, ballet and more. She has been traveling to perform, compete and teach professionally at congresses and other dance studios for 11+ years with dance companies such as Zafire, Santo Rico, La Fuerza, New York Movement and a partnership with Fausto Felix  ‚ÄúFausto & Kate‚Äù winning multiple 1st place and 2nd place titles at the World Salsa Summit.\n\nKatlyn has also been a judge and coach for competitions for 5+ years now, judging competitions along side many other respected artists and coaches in Canada, India, Dominican Republic and many more around USA.",
