      "artistLocation": "CUBA",
      "artistCompany": "",
      "bio": "Marisol Blanco is a renowned Master Teacher, Choreographer, and Performer of Afro-Cuban dance with over 35 years of experience. A graduate of Cuba‚Äôs Superior Institute of Arts (ISA) and The National School of Arts (ENA), she specializes in African Diaspora dances and is known for her popular Rumba classes and Afro-Cuban learning program, the \"HPS\" method. Marisol founded the Sikan Afrocuban Dance Project and has performed with The Cuban National Folkloric Company and Obini-Bata, the first female drumming and dance group in Cuba. Her teaching blends technical skill with cultural and historical depth.",
