      "bio": "Eric ‚ÄúEl Cubanito‚Äù Freeman and Marcela are prominent figures in Colorado‚Äôs salsa scene. Eric is an internationally recognized salsa instructor and videographer, known for his unique blend of salsa styles, including N.Y. mambo, Cuban casino, and elements from L.A., Cumbia, and Puerto Rican salsa. After training in both New York and Cuba, Eric transitioned from electrical engineering to a full-time salsa career in 1999. He has produced 15 instructional videos, selling over 20,000 copies in 75 countries. His groundbreaking series, such as ‚ÄúCool Moves Revealed‚Äù and ‚Äú¬°Salsa a la Cubana!,‚Äù have become best-sellers, making him a global expert on Cuban salsa and its fusion with other styles.\n\nMarcela, originally from Chile, is a salsa instructor based in the Boulder/Denver area. In addition to teaching, she produces popular Latin events, including Havana Nights, SalsaTon, and Guapea. Together, Eric and Marcela contribute significantly to Colorado's vibrant salsa community, offering both instruction and entertainment to dancers at all levels.",
