  "dataSpecialSessions": {
    "Absolute Beginner Track - Salsa": {
      "company": "Somos Dance Studio",
      "description": "Come join us and take your first steps in dance - no sign-up required!\n\nDiscover the joy of dance at the CALDAC convention with our Absolute Beginner Track workshops! Perfect for those new to Salsa or Bachata, these workshops are designed to welcome you into the world of dance with no prior experience required. Separate classes for Salsa and Bachata ensure that you get the focused attention you need to start your dance journey. Best of all, these workshops are free with the purchase of a full pass or VIP pass‚Äîjust be sure to sign up in advance to secure your spot. It‚Äôs all about fun, no judgments, and a fantastic way to get involved in the weekend‚Äôs festivities. ",
      "title": "Absolute Beginner Track - Salsa",
      "price": "0",
      "signup": "no",
      "artistNames": [
        "Sisy Ayala"
      ]
    },
    "Absolute Beginner Track - Bachata": {
      "company": "Somos Dance Studio",
      "description": "Come join us and take your first steps in dance - no sign-up required!\n\nDiscover the joy of dance at the CALDAC convention with our Absolute Beginner Track workshops! Perfect for those new to Salsa or Bachata, these workshops are designed to welcome you into the world of dance with no prior experience required. Separate classes for Salsa and Bachata ensure that you get the focused attention you need to start your dance journey. Best of all, these workshops are free with the purchase of a full pass or VIP pass‚Äîjust be sure to sign up in advance to secure your spot. It‚Äôs all about fun, no judgments, and a fantastic way to get involved in the weekend‚Äôs festivities. Come join us and take your first steps in dance!",
      "title": "Absolute Beginner Track - Bachata",
      "price": "0",
      "signup": "no",
      "artistNames": [
        "Jared and Nicole"
      ]
    },
    "AnD Bachata Instructor - Certification Training": {
      "company": "AnD Academic Network of Dance",
      "description": "Please go to the registration desk to sign up.\n\n- Open to intermediate-advanced dancers\n- Open to (but not limited to) instructors\n- End-of-Course assessment for certification is optional\n\nThis certification course is designed with the ultimate goal of helping the intermediate-advanced dancers and instructors with delivering quality instruction to their students on the AnD Bachata style and technique. \n\nComprised of 4 Modules:\n1. Bachata History & Evolution (Dance and Musical Instrumentation)\n2. Detailed AnD Technique and Fundamental Basic Movements\n3. Partnering Principles to Lead and Follow the Basics\n4. Recommendations and Best Practices for Instructors\n\nCourse Length: approx ~5-6 hours\n\n** To successfully complete the course and receive your official AnD Certificate of Completion you will need to follow instructions provided to coordinate your end of course assessment. PLEASE NOTE certificate is not automatically issued. We reserve the right to deny a certificate of completion if you are not able to successfully demonstrate sufficient understanding of the content. You are generally only allowed to schedule the assessment once.",
      "title": "AnD Bachata Instructor - Certification Training",
      "price": "200",
      "signup": "yes",
      "artistNames": [
        "Alex and Desiree"
      ]
    },
    "Heels Challenge": {
      "company": "Creations by Rafa",
      "description": "Please go to the registration desk to sign up.\n\nJoin us at the CALDAC convention for the Rafa Heels Bootcamp, a unique experience designed to boost your self-confidence and help you feel great in your own skin! Whether you're a seasoned dancer or a complete beginner, no prior experience is necessary, and wearing heels is entirely optional. From Friday, October 18th, to Sunday, October 20th, 2024, you'll work closely with Rafa, refining your skills and building your confidence. As a special highlight, participants have the option to perform with Rafa on Sunday night‚Äîthough it's entirely up to you! Please note that this bootcamp requires a separate purchase in addition to your full or VIP pass. Don't miss this chance to elevate your dance journey!",
      "title": "Heels Challenge",
      "price": "50",
      "signup": "yes",
      "artistNames": [
        "Rafa Gonzalez"
      ]
    },
    "MASTERCLASS - Salsa On1": {
      "company": "Karen y Ricardo",
      "description": "Please go to the registration desk to sign up.\n\nJoin Karen and Ricardo, world-renowned Salsa champions, for an exclusive 2-hour Salsa On1 Masterclass designed for advanced dancers. This high-energy workshop will push your skills to the next level, focusing on intricate footwork, precise partner work, and powerful styling techniques. Known for their electrifying performances and unparalleled technique, Karen and Ricardo will guide you through a masterclass that challenges your speed, timing, and creativity on the dance floor.  This workshop is an add-on priced at $50 and requires participants to already hold a Full Pass, VIP Pass, or Sunday All Day Pass. If you're ready to elevate your Salsa On1 game and learn from the best, this masterclass is for you!",
      "title": "MASTERCLASS - Salsa On1",
      "price": "50",
      "signup": "yes",
      "artistNames": [
        "Karen y Ricardo"
      ]
    }
  },
